script: |
  super -f text -I q5345.spq | sort > q5345.out

inputs:
  - name: q5345.spq
    data: |
      SELECT DISTINCT - col2 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT col1 / col0 IN ( + col0 * tab0.col1 + tab0.col2 );
  - name: tab0

outputs:
  - name: q5345.out
    data: |
      -1
      -33
      -82
